import React from "react";
import App from "./App.css";
function Login(){
    return (
        <section>
            <div className="login">
                <div className="left-login">
                    <img src="https://images.unsplash.com/photo-1560518883-ce09059eeffa?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=773&q=80" alt="key"></img>
                </div>
                <div className="right-logn">
                    <form>
                        <input type="text"></input>
                    </form>

                </div>
            </div>
        </section>
    )
    
}
export default Login;
